  return (
    <Container>
      {/* Toolbar */}
      <ToolBar>
        <div>
          error
          <input type="text" />
          <button>Add</button>
        </div>
        {/* search box */}
        <input type="text" />
        {/* toggle */}
        <div>
          Hide add toggle
          <input type="checkbox" />
        </div>

      </ToolBar>
    </Container>
  )
}
